import React from "react";
import "./FeaturedHotel.css";

const FeaturedHotel = () => {
  return (
    <div>
      <section className="featured-hotel">
        <div className="hotel-image">
          <img
            src="data:image/jpeg;base64,"
            alt="Готель преміум-класу"
          />
        </div>
        <div className="hotel-info">
          <h2>Готель "Рів'єра"</h2>
          <p>
            Готель "Рів'єра" пропонує першокласний сервіс, затишні номери та
            вишуканий інтер’єр. Ідеальне місце для відпочинку та ділових
            подорожей.
          </p>
          <a href="booking.html" className="btn">
            Забронювати
          </a>
        </div>
      </section>

      <section className="about">
        <div className="about-text">
          <h2>Про нас</h2>
          <p>
            Ми об'єднуємо найкращі готелі України для вашого комфортного
            перебування.
          </p>
          <a href="about.html" className="btn">
            Дізнатися більше
          </a>
        </div>
        <div className="about-image">
          <img
            src="data:image/jpeg;base64,"
            alt="Про готель"
          />
        </div>
      </section>
    </div>
  );
};

export default FeaturedHotel;
